import React from 'react'

const Footer = () => {
    return(
        <div className='py-4 text-center bg-gray-400'>
            MyDailyStatus é um projeto criado durante o Fullstack lab do DevPleno.<br/>
            Implementado por Cleber Araújo{''} <br/>
            <a href='https://linkedin.com/in/cleber-lopes-araujo/'>linkedin</a> - <a href='https://github.com/cleber-lopes-silva'>github</a>
        </div>
    )
}

export default Footer
